// Descripción: Este código maneja la lógica para mostrar y administrar una tabla de bebidas,
//              incluyendo funcionalidades para agregar, editar, inactivar y eliminar productos.

// Datos iniciales de productos
var text = '{"usuarios" : [ ' +
'{"foto" : "data:image/jpeg;base64,", "nombre" : "Agua de horchata", "precio":"30", "categoria" : "Aguas", "descripcion": "Jarra de agua de horchata (1L)", "estatus" : "Activo"}, ' +
'{"foto" : "data:image/webp;base64,", "nombre" : "Jugo de naranja", "precio":"25", "categoria" : "Jugos", "descripcion": "Vaso de jugo de naranjas frescas (600ml)", "estatus" : "Activo"}, ' +
'{"foto" : "data:image/jpeg;base64,", "nombre" : "Té helado", "precio":"35", "categoria" : "Tés", "descripcion": "Vaso de té helado con limón (600ml)", "estatus" : "Activo"}, ' +
'{"foto" : "data:image/webp;base64,", "nombre" : "Limonada", "precio":"28", "categoria" : "Aguas", "descripcion": "Vaso de limonada fresca y dulce (600ml)", "estatus" : "Activo"}, ' +
'{"foto" : "data:image/jpeg;base64,", "nombre" : "Aguas", "precio":"32", "categoria" : "Agua de sabor", "descripcion": "Jarra de Agua de jamaica (1L)", "estatus" : "Activo"}, ' +
'{"foto" : "data:image/jpeg;base64,", "nombre" : "Smoothie de fresa", "precio":"40", "categoria" : "Batidos", "descripcion": "Vaso de smoothie cremoso de fresas (600ml)", "estatus" : "Activo"}, ' +
'{"foto" : "data:image/jpeg;base64,", "nombre" : "Café frío", "precio":"45", "categoria" : "Cafés", "descripcion": "Café preparado y enfriado (600ml)", "estatus" : "Activo"}, ' +
'{"foto" : "data:image/webp;base64,", "nombre" : "Batido de plátano", "precio":"38", "categoria" : "Batido", "descripcion": "Batido cremoso de plátano (600ml)", "estatus" : "Activo"} ' +
']}';

let users = JSON.parse(text).usuarios.map((user, index) => ({
    id: String(index + 1).padStart(4, '0'),
    foto: user.foto,
    nombre: user.nombre,
    precio: user.precio,
    categoria: user.categoria,
    descripcion: user.descripcion,
    estatus: user.estatus
}));

// Colores disponibles para la tabla
const colors = ['#FA812F'];
const randomColor = colors[Math.floor(Math.random() * colors.length)];
document.body.style.backgroundColor = randomColor;

const thElements = document.querySelectorAll('th');
thElements.forEach(function(th) {
    th.style.backgroundColor = randomColor;
});

// Función para renderizar la tabla
function renderTable() {
    const tableBody = document.querySelector('#userTable tbody');
    tableBody.innerHTML = '';

    users.forEach(function(user) {
        const row = document.createElement('tr');
        row.innerHTML = `
            <td>${user.id}</td>
            <td><img src="${user.foto}" alt="Foto de ${user.nombre}" width="200"></td> <!-- Aumenta el tamaño a 200px -->
            <td>${user.nombre}</td>
            <td>${user.descripcion}</td>
            <td>$${user.precio}</td>
            <td>${user.categoria}</td>
            <td>${user.estatus}</td>
            <td>
                <button class="icon-button" onclick="editUser('${user.id}')"><img src="https://img.icons8.com/ios-filled/50/000000/edit.png" alt="Editar"></button>
                <button class="icon-button" onclick="confirmToggleStatus('${user.id}')"><img src="https://img.icons8.com/ios-filled/50/000000/trash.png" alt="Eliminar"></button>
            </td>
        `;
        tableBody.appendChild(row);
    });

    // Llamar a la función para mostrar los objetos en la consola
    logUsersToConsole();
}

// Función para abrir el formulario de usuarios
function openUserForm(user = {}) {
    const isEditMode = Boolean(user.id);
    Swal.fire({
        title: user.id ? 'Editar Producto' : 'Agregar Producto',
        html: `
            <input type="hidden" id="userId" value="${user.id || ''}">
            <label for="foto">Foto:</label>
            <input type="file" id="foto" class="swal2-file" accept="image/*">
            ${user.foto ? `<img src="${user.foto}" id="previewFoto" alt="Foto de ${user.nombre}" width="200"><br>` : ''} <!-- Aumenta el tamaño a 200px -->
            <label for="nombre">Nombre:</label>
            <input type="text" id="nombre" class="swal2-input" value="${user.nombre || ''}">
            <label for="descripcion">Descripción:</label>
            <textarea id="descripcion" class="swal2-textarea">${user.descripcion || ''}</textarea>
            <label for="precio">Precio:</label>
            <input type="number" id="precio" class="swal2-input" value="${user.precio || ''}"><br>
            <label for="categoria">Categoría:</label>
            <select id="categoria" class="swal2-select">
                <option value="Refrescos" ${user.categoria === 'Refrescos' ? 'selected' : ''}>Refrescos</option>
                <option value="Aguas" ${user.categoria === 'Aguas' ? 'selected' : ''}>Aguas</option>
                <option value="Jugos" ${user.categoria === 'Jugos' ? 'selected' : ''}>Jugos</option>
                <option value="Cafés" ${user.categoria === 'Cafés' ? 'selected' : ''}>Cafés</option>
                <option value="Bebidas alcohólicas" ${user.categoria === 'Bebidas alcohólicas' ? 'selected' : ''}>Bebidas alcohólicas</option>
                <option value="Tés" ${user.categoria === 'Tés' ? 'selected' : ''}>Tés</option>
                <option value="Batidos" ${user.categoria === 'Batidos' ? 'selected' : ''}>Batidos</option>
            </select>
            ${isEditMode ? `
                <label for="estatus">Estatus:</label>
                <select id="estatus" class="swal2-select">
                    <option value="Activo" ${user.estatus === 'Activo' ? 'selected' : ''}>Activo</option>
                </select>
            ` : ''}
        `,
        focusConfirm: false,
        confirmButtonText: 'Guardar',
        preConfirm: () => {
            return new Promise((resolve, reject) => {
                const fotoInput = document.getElementById('foto');
                const nombreInput = document.getElementById('nombre');
                const descripcionInput = document.getElementById('descripcion');
                const precioInput = document.getElementById('precio');
                const categoriaInput = document.getElementById('categoria');

                // Validación de campos obligatorios
                if (!nombreInput.value || !descripcionInput.value || !precioInput.value || !categoriaInput.value || (isEditMode && !user.foto && !fotoInput.files[0])) {
                    Swal.showValidationMessage('Todos los campos son obligatorios');
                    return false;
                }

                // Validación del precio
                if (isNaN(precioInput.value) || precioInput.value <= 0) {
                    Swal.showValidationMessage('El precio debe ser un número válido y mayor a 0');
                    return false;
                }

                // Manejo de la imagen
                if (fotoInput.files[0]) {
                    const reader = new FileReader();
                    reader.onload = function(e) {
                        resolve({
                            id: document.getElementById('userId').value,
                            foto: e.target.result,
                            nombre: document.getElementById('nombre').value,
                            descripcion: document.getElementById('descripcion').value,
                            precio: document.getElementById('precio').value,
                            categoria: document.getElementById('categoria').value,
                            estatus: isEditMode ? 'Activo' : 'Activo',
                        });
                    };
                    reader.readAsDataURL(fotoInput.files[0]);
                } else {
                    resolve({
                        id: document.getElementById('userId').value,
                        foto: user.foto,
                        nombre: document.getElementById('nombre').value,
                        descripcion: document.getElementById('descripcion').value,
                        precio: document.getElementById('precio').value,
                        categoria: document.getElementById('categoria').value,
                        estatus: isEditMode ? 'Activo' : 'Activo',
                    });
                }
            });
        }
    }).then(function(result) {
        if (result.isConfirmed) {
            const { id, foto, nombre, descripcion, precio, categoria, estatus } = result.value;
            if (id) {
                const userIndex = users.findIndex(function(user) { return user.id === id; });
                users[userIndex] = { id, foto, nombre, descripcion, precio, categoria, estatus };
            } else {
                const newId = String(users.length ? Math.max(...users.map(function(user) { return parseInt(user.id); })) + 1 : 1).padStart(4, '0');
                users.push({ id: newId, foto, nombre, descripcion, precio, categoria, estatus });
            }
            renderTable();
        }
    });

    const fotoInput = document.getElementById('foto');
    fotoInput.addEventListener('change', function() {
        const previewFoto = document.getElementById('previewFoto');
        if (fotoInput.files && fotoInput.files[0]) {
            const reader = new FileReader();
            reader.onload = function(e) {
                if (previewFoto) {
                    previewFoto.src = e.target.result;
                } else {
                    const img = document.createElement('img');
                    img.id = 'previewFoto';
                    img.src = e.target.result;
                    img.width = 200; // Aumenta el tamaño a 200px
                    fotoInput.insertAdjacentElement('afterend', img);
                }
            };
            reader.readAsDataURL(fotoInput.files[0]);
        }
    });
}

// Función para editar un producto
function editUser(id) {
    const user = users.find(function(user) { return user.id === id; });
    openUserForm(user);
}

// Función para confirmar el cambio de estatus al eliminar
function confirmToggleStatus(id) {
    const user = users.find(function(user) { return user.id === id; });

    Swal.fire({
        title: user.estatus === 'Activo' ? '¿Estás seguro de inactivar esta bebida?' : '¿Estás seguro de eliminar esta bebida?',
        text: user.estatus === 'Activo' ? 'Esta acción cambiará el estatus del producto a inactivo.' : 'Esta acción eliminará el producto.',
        icon: 'warning',
        showCancelButton: true,
        confirmButtonColor: '#3085d6',
        cancelButtonColor: '#d33',
        confirmButtonText: user.estatus === 'Activo' ? 'Sí, inactivar' : 'Sí, eliminar',
        cancelButtonText: 'Cancelar'
    }).then(function(result) {
        if (result.isConfirmed) {
            if (user.estatus === 'Activo') {
                toggleStatus(id);
            } else {
                deleteUser(id);
            }
        }
    });
}

// Función para cambiar el estatus de un producto a Inactivo
function toggleStatus(id) {
    const userIndex = users.findIndex(function(user) { return user.id === id; });
    if (userIndex !== -1 && users[userIndex].estatus === 'Activo') {
        users[userIndex].estatus = 'Inactivo';
        renderTable();
    }
}

// Función para eliminar un producto
function deleteUser(id) {
    Swal.fire({
        title: 'Eliminar Producto',
        text: '¿Estás seguro de que deseas eliminar este producto?',
        icon: 'warning',
        showCancelButton: true,
        confirmButtonColor: '#3085d6',
        cancelButtonColor: '#d33',
        confirmButtonText: 'Sí, eliminar',
        cancelButtonText: 'Cancelar'
    }).then(function(result) {
        if (result.isConfirmed) {
            const userIndex = users.findIndex(function(user) { return user.id === id; });
            if (userIndex !== -1) {
                users.splice(userIndex, 1);
                renderTable();
            }
        }
    });
}

// Función para buscar en la tabla
function searchTable() {
    const input = document.getElementById('searchInput');
    const filter = input.value.toLowerCase();
    const table = document.getElementById('userTable');
    const tr = table.getElementsByTagName('tr');

    for (let i = 1; i < tr.length; i++) {
        tr[i].style.display = 'none';
        const td = tr[i].getElementsByTagName('td');
        for (let j = 1; j < td.length; j++) { // Empezamos en 1 para excluir la columna de foto
            if (td[j]) {
                if (td[j].innerHTML.toLowerCase().indexOf(filter) > -1) {
                    tr[i].style.display = '';
                    break;
                }
            }
        }
    }
}

// Función para registrar los productos en la consola
function logUsersToConsole() {
    console.log("Productos:", users);
}

// Renderizar la tabla al cargar la página
renderTable();
